export interface TodosState {
	todos: any[];
	loading: boolean;
	error: null | string;
}

export enum TodosActiobTypes {
 FETCH_TODOS = 'FETCH_TODOS',
 FETCH_TODOS_SUCCESS = 'FETCH_TODOS_SUCCESS',
 FETCH_TODOS_ERROR = 'FETCH_TODOS_ERROR'
}

interface FetchTodosAction {
	type: TodosActiobTypes.FETCH_TODOS,
}

interface FetchTodosSuccessAction {
	type: TodosActiobTypes.FETCH_TODOS_SUCCESS,
	payload: any[],
}

interface FetchTodosErrorAction {
	type: TodosActiobTypes.FETCH_TODOS_ERROR,
	payload: string,
}

export type TodosAction = FetchTodosAction | FetchTodosErrorAction |FetchTodosSuccessAction
